                $provider = (!empty($invoice))? $invoice->provider:'';
                $agent = (!empty($invoice))? $invoice->agent:'';
                $comm = (!empty($invoice))? $invoice->getCom() :'';
                $commission_rate = (!empty($comm))?$comm->comm:0;
                $amount_dollar = (!empty($profit))?$profit->pay_agent_amount_comm:0;

                $commision_dollar_include_GST_VND = $commission_rate * $amount_dollar /100;
                $commision_dollar_include_GST_total_VND += $commision_dollar_include_GST_VND;

                $GST_VND = ($commision_dollar_include_GST_VND/1.1) * 10/100;
                $GST_total_VND += $GST_VND;

                $commision_dollar_exclude_GST_VND = $commision_dollar_include_GST_VND - $GST_VND;
                $commision_dollar_exclude_GST_total_VND +=$commision_dollar_exclude_GST_VND;

                $exchange_rate = (!empty($profit))?$profit->pay_agent_exchange_rate:0;

                // $commision_VND = $commision_dollar_exclude_GST_VND *$exchange_rate;
                $commision_VND =$commision_dollar_exclude_GST_VND * $exchange_rate;
                $commision_total_VND += $commision_VND;

                $bonus_per = (!empty($profit))?$profit->pay_agent_bonus:0;
                $bonus_VND = $amount_dollar * $exchange_rate * $bonus_per /100;
                $bonus_total_VND += $bonus_VND;

                $total_VND = $commision_VND + $bonus_VND;
                $total_of_total_VND += $total_VND;

                $commision_dollar = $amount_dollar * $commission_rate/100 / 1.1;
                $commision_dollar_total += $commision_dollar;
                $gst= $commision_dollar * 0.1;
                $gst_total += $gst;
                $commision_gst= $commision_dollar+$gst;
                $commision_dollar_gst_total +=$commision_gst;
                $payment_status = (!empty($profit) && $profit->comm_status == 1)?'Done':'Refund';
