    <script>
        //
        $(document).ready(function(){
            var doc = new jsPDF('p', 'pt', 'letter');
            var elementHTML = $('#rptOnlyAgent1_14845')[0];
            console.log(elementHTML);
            var specialElementHandlers = {
                '#elementH': function (element, renderer) {
                    return true;
                }
            };
            doc.fromHTML(elementHTML, 15, 15, {
                'width': 170,
                'elementHandlers': specialElementHandlers
            },function(bla){doc.save('saveInCallback.pdf');},0);

        });


        $('.download_pdf').on('click',function(e){
            e.preventDefault();
            const queryString = window.location.search;
            const urlParams = new URLSearchParams(queryString);
            let start_date = urlParams.get('start_date');
            let end_date =  urlParams.get('end_date');
            $.ajax({
                url:"{{route('report.exportPdf')}}",
                type:'get',
                data:{
                    'start_date':start_date,
                    'end_date':end_date
                },
                success:function(data){
                    console.log(data);
                }
            })
        })
        window.onload = function() {
            var c = document.getElementById("myCanvas");
            var ctx = c.getContext("2d");
            var img = document.getElementById("scream");
            ctx.drawImage(img,0,0,340,113);
        }

        var tableToExcel = (function () {
        var uri = 'data:application/vnd.ms-excel;base64,',
            template = '<html xmlns:o="urn:schemas-microsoft-com:office:office" xmlns:x="urn:schemas-microsoft-com:office:excel" xmlns="http://www.w3.org/TR/REC-html40"><head><!--[if gte mso 9]><xml><x:ExcelWorkbook><x:ExcelWorksheets><x:ExcelWorksheet><x:Name>{worksheet}</x:Name><x:WorksheetOptions><x:DisplayGridlines/></x:WorksheetOptions></x:ExcelWorksheet></x:ExcelWorksheets></x:ExcelWorkbook></xml><![endif]--></head><body><table>{table}</table></body></html>',
            base64 = function (s) {
                return window.btoa(unescape(encodeURIComponent(s)))
            }, format = function (s, c) {
                return s.replace(/{(\w+)}/g, function (m, p) {
                    return c[p];
                })
            }
        return function (table, name, filename) {
            if (!table.nodeType) table = document.getElementById(table);
            var ctx = {
                worksheet: name || 'Worksheet',
                table: table.innerHTML
            }
            document.getElementById("dlink").href = uri + base64(format(template, ctx));
            document.getElementById("dlink").download = filename;
            document.getElementById("dlink").traget = "_blank";
            document.getElementById("dlink").click();
        }
    })();

        function download() {
            $(document).find('tfoot').remove();
            var name = 'abc';
            tableToExcel('table2', 'Sheet 1', name + '.xlsx')
            //setTimeout("window.location.reload()",0.0000001);
        }

        var btn = document.getElementById("btn");
        btn.addEventListener("click", download);
    </script>
